<!doctype html>
<div id=asd></div>
<script>
	console.log("Yes, this thing actually runs!");
	var Module = {
		print: (...args) => console.log(...args),
		canvas: null,
		setStatus: (text) => {
			document.getElementById("asd").innerText = text;
		},
		totalDependencies: 0,
		monitorRunDependencies: (left) => {
			this.totalDependencies = Math.max(this.totalDependencies, left);
			Module.setStatus(left ? (this.totalDependencies-left) + '/' + this.totalDependencies : '100%');
		}
	};
</script>
